  return (
    <StyledDiv>
    <Styledh1> Sam Swift <br/> Frontend Developer</Styledh1>
    <StyledSpacer/>

ã…¡
Projects

Jo-Jo.club - This is a website I built with React for a customer in Taiwan, according to their specifications.
Stake.Zombie.Finance - This is a Dapp built with React, Typescript and Ethereum.  Stake.Zombie.Finance  is a social experiment with the logic of (FOMO) it has an ever shifting price from day to day due to its Rebase and Debase of supply.  In order to view the site's full features you must use an Ethereum compatible wallet such as Metamask.
Shrimp.Finance - This is a Dapp built with React, Typescript and Ethereum. Shrimp.Finance  is a user portal for supplying liquidity and being rewarded with our Erc-20.In order to view the site's full features you must use an Ethereum compatible wallet such as Metamask.
Terminowl.com - The current home of my favorite projects I have completed, and more information about me.

    <StyledNote> I have experience working professionally with <br/>React, Egret, Angular and building Dapps with Ethereum. </StyledNote>
    </StyledDiv>
  )
}
