    display: flex;
    flex-flow: column;

`

const Styledh1 = styled.p`
    margin-top: 5%;
    margin-bottom: 0px;
    font-size: 34px;
`

const StyledNote = styled.p`
    font-size: 17px;
`

const StyledSpacer = styled.div`
height: 15px;
width: 100%;
`


export default Introduction
